import supertest from 'supertest';
const request = supertest('https://gorest.co.in/public-api/');
import { expect } from 'chai';
const TOKEN ='7d6a1104205bf995547faa7284010794b62538937348decad674db400e598561';

xdescribe('Users', () => {
    it('GET/users',  () => {
        // request.get(`users?access-token=${TOKEN}`).end((err,res)=>{
        //     expect(res.body.data).to.not.be.empty;
        //     done();
            
        // });
        return request.get(`users?access-token=${TOKEN}`).then((res)=>{
        expect(res.body.data).to.not.be.empty;
        });
});
it('GET /users/:id', () => {
    return request.get(`users/1?access-token=${TOKEN}`).then((res)=>{
        expect(res.body.data.id).to.be.eq(1);
    });
    

});
it('GET /users with query params', () => {
    const url =`users?access-token=${TOKEN}&page=5&gender=female&status=active`;
    return request.get(url).then((res)=>{
        expect(res.body.data).to.not.be.empty;
        res.body.data.forEach((data)=> {
       expect(data.gender).to.eq('female');
       expect(data.status).to.eq('active');
        });
    });
});
it('GET /users with query params with pagination', () => {
    const url =`users?access-token=${TOKEN}&page=5&gender=female&status=active`;
    return request.get(url).then((res)=>{
        expect(res.body.meta.pagination).to.not.be.empty;
        expect(res.body.meta.pagination.page).to.eq(5);
});
});
it('POST /users', () =>{
    const data ={
        email:`wekaretest-${Math.floor(Math.random()*555)}@mail.ca`,
        name:'wekare',
        gender:'male',
        status:'inactive'
    };
    return request.post('users').set("Authorization",`Bearer ${TOKEN}`).send(data).then((res)=> {
        console.log(res.body);
        expect(res.body.data.email).to.eq(data.email);
        expect(res.body.data.status).to.eq(data.status);
    })
})
it ('POST /users', () =>{
    const data ={
        email:`wekaretest-${Math.floor(Math.random()*555)}@mail.ca`,
        name:'wekare',
        gender:'male',
        status:'inactive'
    };
    return request.post('users').set("Authorization",`Bearer ${TOKEN}`).send(data).then((res)=> {
        expect(res.body.data).to.deep.include(data);
    })
})
it('PUT /users/ :id' , () => {
    const data = {
        status:'active',
        name: `wekare -${Math.floor(Math.random()*555)}`,
    }
    return request.put('users/1360').set('Authorization',`Bearer ${TOKEN}`).send(data).then((res)=>{
        console.log(res.body.data);
        expect(res.body.data).to.deep.include(data);
    })
})
it('DELETE /users/ :id', ()=>{
    return request.delete('users/17').set('Authorization',`Bearer ${TOKEN}`).then((res)=>{
        expect(res.body.data).to.be.eq(null);
    })
})
});

